import React, {Component} from "react";
import './add_product';
import '../backend/delete.php'
import axios from 'axios';
import $ from 'jquery';

export default  class RecordList extends Component {
    constructor() {
        super();
        this.test = this.test.bind(this);
     
    }

    
    test(e) {
      
      axios.get('http://localhost/scandiweb-test/src/backend/delt.php')
        .then(console.log('Mass Deleted'))
        .catch(err => console.log(err))
      
  }
 

  

    render() {


        return(
            
            <div className="box">
               <button class="button-delete" role="button" onChange={e => this.test(e)} >DELETE</button>
            
            <td className = 'a'>{this.props.obj.d_sku}</td>

            <td className = 'a'>{this.props.obj.d_name}</td>
  
            <td className = 'a'>{this.props.obj.d_price + "$"}</td>
  
            <td className = 'a'>{this.props.obj.d_attribute}</td>
            

            </div>
        )
    }
}
